import React from "react";
import classes from './chooseModal.module.scss';

const ChooseModal = ({categories, visible, setVisible}) => {
  return (
    <div className={classes.chooseModal}>
      <input type="radio" name="chooseCategory" id="all-id-modal" />
      <label for="all-id-modal">All</label>
      <ul>
        {categories.map((item) => (
          <li>
            <input type="radio" name="chooseCategory" id={`${item}-id-modal`} />
            <label for={`${item}-id-modal`}>{item}</label>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ChooseModal;
